import React from 'react'

export const Card = ({item}) => {
  return (
    <div className='my-8'>
        <a href="https://jay035.github.io/Calculator/">
          {/* <!-- screenshot --> */}
          <img className='w-[40%]' src={item.image} alt="work screenshot" />
          {/* overlay */}
          <div className=""></div>
        </a>
        <div className="">
          <p className="">{item.title} </p>
          <p className="">{item.description}</p>
          
          <div className="">
            {/* <!-- link to github repo --> */}
            <a href={item.githubURL}>

            </a>
            {/* <!-- link to live site  --> */}
            <a href={item.demoURL}>

            </a>
          </div>
        </div>
    </div>
  )
}
